import React, { useContext, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { AuthenticationContext } from '../AuthenticationContext'; 

// Signup Page
const Signup = () => {
    const navigate = useNavigate()
    const { setUserAndAuthenticate } = useContext(AuthenticationContext);

    const [ username, setUsername ] = useState('');
    const [ email, setEmail ] = useState('');
    const [ password1, setPassword1 ] = useState('');
    const [ password2, setPassword2 ] = useState('');
    const [ error, setError ] = useState('');

    const handleUsernameChange = (e) => {
        setUsername(e.target.value);
    };

    const handleEmailChange = (e) => {
        setEmail(e.target.value);
    };

    const handlePassword1Change = (e) => {
        setPassword1(e.target.value);
    };

    const handlePassword2Change = (e) => {
        setPassword2(e.target.value);
    };

    const storeUserInLocalStorage = (userId) => {
        localStorage.setItem('userId', userId);
    };

    const submitForm = async (e) => {
        e.preventDefault();
        const trimmedUsername = username.trim();
        const trimmedPassword1 = password1.trim();
        const trimmedPassword2 = password2.trim();
        const trimmedEmail = email.trim();
        const regex = /^[a-zA-Z0-9]*$/;
        const passwordRegex = /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[@$!%*?&])[A-Za-z\d@$!%*?&]{8,}$/;

        // Handle username not long enough
        if (trimmedUsername.length < 5) {
            setError("Usernames must be five or more characters.");
            return;
        }

        // Handle username contains special characters
        if (!regex.test(trimmedUsername)) {
            setError("Usernames must only contain letters and numbers.");
            return;
        }

        // Handle passwords don't match
        if (trimmedPassword1 !== trimmedPassword2) {
            setError("Passwords don't match");
            return;
        }

        // Handle username doesn't meet complexity requirements
        if (!passwordRegex.test(trimmedPassword1)) {
            setError("Your password must contain at least one lowercase letter, one uppercase letter, one digit, one special character, and be at least 8 characters long.");
            return;
        }

        // Reset error
        setError('');

        // Request sign up from server
        try {
            const userData = {
                username: trimmedUsername,
                password: trimmedPassword1,
                email: trimmedEmail
            };

            const response = await fetch('http://127.0.0.1:3002/signup/request', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(userData)
            });

            if (!response.ok) {
                // If response status is not OK, extract error message from response body
                const errorData = await response.json();
                throw new Error(errorData.errorMessage || 'Unknown server error. Please try again later.');
            }

            const responseData = await response.json();
            const userId = responseData.user_id;

            // Handle successful sign-up
            storeUserInLocalStorage(userId); // Store user ID in local storage
            setUserAndAuthenticate(userId); // Set user in authentication context

            // Redirect to home page
            navigate('/');
        } catch (error) {
            // If sign up fails, show the user the error message
            setError(error.message);
        }
    }
    return (
        <div className="container">
            <div className="row justify-content-center mt-5">
            <div className="col-md-6">
                <div className="card">
                    <div className="card-body">
                        <h1 className="card-title text-center mb-4">Signup</h1>
                        <form onSubmit={submitForm}>
                            <div className="mb-3">
                                <label htmlFor="email" className="form-label" >Email</label>
                                <input type="email" className="form-control" id="email" placeholder="Email" onChange={handleEmailChange} required />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="username" className="form-label">Username</label>
                                <input type="text" className="form-control" id="username" placeholder="Username" onChange={handleUsernameChange} required />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="password" className="form-label">Password</label>
                                <input type="password" className="form-control" id="password" placeholder="Password" onChange={handlePassword1Change} required />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="confirmPassword" className="form-label">Confirm Password</label>
                                <input type="password" className="form-control" id="confirmPassword" placeholder="Confirm password" onChange={handlePassword2Change} required />
                            </div>
                            {error && (
                                <div className="alert alert-danger" role="alert">
                                    {error}
                                </div>
                            )}
                            <button type="submit" className="btn btn-primary btn-block">Sign up</button>
                        </form>
                    </div>
                </div>
            </div>
        </div>
    </div>
    );
};

export default Signup;
